import React from "react";
import "bootstrap/dist/js/bootstrap.min.js";
import { Link } from "react-router-dom";

export default function Home() {
  return (
    <React.Fragment>
      <div style={{ display: 'flex', height: '100vh' }}>
        {/* Sidebar */}
        <div className="sidebar" style={{ width: '200px', backgroundColor: '#f0f0f0' }}>
          <Link to="/phone">Telefon</Link>
          <Link to="/pc">Számítógép</Link>
          <Link to="/headphones">Fülhallgató</Link>
          <Link to="/hardver">Hardver</Link>
          <Link to="/tv">TV</Link>
          <Link to="/other">Egyéb</Link>
        </div>

        {/* Container for Title "Legújabb hirdetések" and "Iphone 13" */}
        <div style={{ marginLeft: '20px', display: 'flex', flexDirection: 'column', alignItems: 'flex-start' }}>
          {/* Title "Legújabb hirdetések" */}
          <h1>Legújabb hirdetések</h1>

          {/* "Iphone 13" text directly below the title */}
          <h1>Iphone 13</h1>
        </div>
      </div>
    </React.Fragment>
  );
}
